import * as React from 'react';
import {useState} from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import {Paper} from '@mui/material'

export default function Student() {
    const style= {padding: '50px 20px', width:600, margin: '20px auto'}
    const[name,setName]=useState('')
    const[address,setAdress]=useState('')

    return (
    <Box
      component="form"
      sx={{
        '& > :not(style)': { m: 1, width: '25ch',  },
      }}
      noValidate
      autoComplete="off"
    >
        
        <Paper elevation={3} style={style}>
            <h1 style={{color:"blue"}}><u>Add Student</u></h1>
            <form className="Student">
                <TextField id="studentName" label="Student Name" variant="outlined" fullWidth
                value={name}
                onChange={(e)=>setName(e.target.value)} />
                <TextField id="studentAddress" label="Address" variant="outlined" fullWidth
                value={address}
                onChange={(e)=>setAddress(e.target.value)}/>
            </form>
        </Paper>
    </Box>
  );
}
